function getCurrentRoundScore(gamestate, currentRound){
    let currentScore = 1;
    for (let i = currentRound; i > 0; i--){
        if (gamestate.moves[i].p1 === gamestate.moves[i].p2){
            currentScore++;
        }
        else {
            return currentScore;
        }
    }
    return currentScore;
}

function whoWon(p1,p2) {
    if (p1 === 'S') {
        switch (p2) {
            case 'R':
                return 2;
            case 'P':
                return 1;
            case 'D':
                return 2;
            case 'W':
                return 1;
            case 'S':
                return 0;
        }
    }
    if (p1 === 'R') {
        switch (p2) {
            case 'R':
                return 0;
            case 'P':
                return 2;
            case 'D':
                return 2;
            case 'W':
                return 1;
            case 'S':
                return 1;
        }
    }

    if (p1 === 'P') {
        switch (p2) {
            case 'R':
                return 1;
            case 'P':
                return 0;
            case 'D':
                return 2;
            case 'W':
                return 1;
            case 'S':
                return 2;
        }
    }

    if (p1 === 'D') {
        switch (p2) {
            case 'R':
                return 1;
            case 'P':
                return 1;
            case 'D':
                return 0;
            case 'W':
                return 2;
            case 'S':
                return 1;
        }
    }
    if (p1 === 'W') {
        switch (p2) {
            case 'R':
                return 2;
            case 'P':
                return 2;
            case 'D':
                return 1;
            case 'W':
                return 0;
            case 'S':
                return 2;
        }
    }
}






    interface gamestate {
    moves: round[]
}

interface round {
    p1: outcome;
    p2: outcome
}

type outcome = 'R'|'S'|'P'|'D'|'W'